import React from "react";
import { Link, Route } from "react-router-dom";

const Category = ({ match }) => (
  <div>
    <ul>
      <li>
        <Link to={`${match.url}/shoes`}>Shoes</Link>
      </li>
      <li>
        <Link to={`${match.url}/boots`}>Boots</Link>
      </li>
    </ul>
  </div>
);

export default Category;
